using ABCBrasil.IB.Corporate.Core.Dsl.Lib.Notification;
using ABCBrasil.IB.Corporate.Core.Dsl.Lib.Tracer;
using ABCBrasil.OpenBanking.Pagamento.Core.Common;
using ABCBrasil.OpenBanking.Pagamento.Core.Interfaces.Repository;
using ABCBrasil.OpenBanking.Pagamento.Core.Interfaces.Services;
using ABCBrasil.OpenBanking.Pagamento.Core.Issuer;
using ABCBrasil.OpenBanking.Pagamento.Core.Models.AbcBrasilApiIntegracao.CoreComprovante;
using ABCBrasil.OpenBanking.Pagamento.Core.Services;
using ABCBrasil.OpenBanking.Pagamento.Core.ViewModels.Arguments.Comprovante;
using ABCBrasil.OpenBanking.Pagamento.Core.ViewModels.Arguments.Pagamento;
using AutoMapper;
using Castle.Windsor;
using FluentAssertions;
using Microsoft.Extensions.Options;
using Moq;
using System;
using System.Threading.Tasks;
using Xunit;

namespace ABCBrasil.OpenBanking.Pagamento.Tests.Unit.Services
{
    public class ComprovanteServiceTest
    {
        readonly IWindsorContainer _container;
        IComprovanteService _service;

        public ComprovanteServiceTest()
        {
            _container = new WindsorContainer();
            _container.Install(new BaseInstaller<ComprovanteService>());

            _container.Resolve<Mock<IOptions<AbcBrasilApiSettings>>>()
                .Setup(x => x.Value)
                .Returns(new AbcBrasilApiSettings { });

            _service = _container.Resolve<ComprovanteService>();
        }

        [Fact(DisplayName = "ComprovanteServiceTest - [ObterComprovante] - #01 - CENÁRIO - EXCEÇÃO")]
        [Trait("Core - ObterComprovante Exception", "ERROR")]
        public async Task Retornar_Excecao_ObterComprovante()
        {
            // Arrange
            Builder.ArrangeServiceIssuer(_container, Issues.se3045);
            Mock<IPagamentoRepository> mockRepo = new Mock<IPagamentoRepository>();
            Mock<IAbcBrasilApiIntegracaoService> mockApi = new Mock<IAbcBrasilApiIntegracaoService>();
            Mock<ITraceHandler> mockHandler = new Mock<ITraceHandler>();
            Mock<INotificationHandler> moclNotif = new Mock<INotificationHandler>();
            Mock<IApiIssuer> mockIssuer = new Mock<IApiIssuer>();
            var Repo = new SituacaoPagamentoResponse { CodigoBarras = "" };
            mockRepo.Setup(m => m.SituacaoProtocolo(It.IsAny<string>())).Throws(new Exception());

            _container.Resolve<Mock<IComprovanteService>>().Setup(x => x.ObterComprovante(It.IsAny<string>()))
              .Throws(new Exception());

            // Act
             _service = new ComprovanteService(mockApi.Object, mockHandler.Object, moclNotif.Object, mockRepo.Object, mockIssuer.Object);
            var actionResult = await _service.ObterComprovante(It.IsAny<string>());

            // Assert
            actionResult.Should().BeNull();
        }

        [Fact(DisplayName = "ClientServiceTests - [ObterComprovante] - #02 - CENÁRIO - SUCESSO")]
        [Trait("Core - ObterComprovante Payload Response Ok", "SUCCESS")]
        public async Task Retornar_Sucesso_ObterComprovante()
        {
            // Arrange
            var config = new MapperConfiguration(opts =>
            {
                opts.CreateMap<ComprovanteService, ComprovanteService>();
            });
            
           
            Mock<IPagamentoRepository> mockRepo = new Mock<IPagamentoRepository>();
            Mock<IAbcBrasilApiIntegracaoService> mockApi = new Mock<IAbcBrasilApiIntegracaoService>();
            Mock<ITraceHandler> mockHandler = new Mock<ITraceHandler>();
            Mock<INotificationHandler> moclNotif = new Mock<INotificationHandler>();
            Mock<IApiIssuer> mockIssuer = new Mock<IApiIssuer>();


            var model = new CoreComprovanteResponse()
            {
                Status = true,
                Name = "ABCBrasil.Core.Comprovante.Api",
                EnvironmentName = "Development",
                //Date = Convert.ToDateTime("20200722"),
            };
            
                var Data = new CoreComprovanteResponse.CoreComprovanteResponseDatas
                {
                    NomeArquivo = "ComprovantesBoleto.pdf",
                    Flgerado = true,
                    Mensagem = "Gerado com sucesso",
                    ArquivoGerado = ""


                };
            model.Data.Add(Data);
            mockApi.Setup(m => m.ObterComprovante(It.IsAny<string>())).ReturnsAsync(model);
            var Repo = new SituacaoPagamentoResponse { CodigoBarras = "" };

            mockRepo.Setup(m => m.SituacaoProtocolo(It.IsAny<string>())).ReturnsAsync(Repo);
            

            //_container.Resolve<Mock<IMapper>>().Setup(x => x.Map<ComprovanteResponse>().Returns(model);

            ComprovanteService _service = new ComprovanteService(mockApi.Object, mockHandler.Object, moclNotif.Object, mockRepo.Object, mockIssuer.Object);
            // Act
            var actionResult = await _service.ObterComprovante(It.IsAny<string>());

            // Assert
            actionResult.Should().NotBeNull();
            var requestResult = actionResult.Should().BeOfType<ComprovanteResponse>().Subject;
            requestResult.Should().NotBeNull();
            requestResult.Flgerado.Should().BeTrue();
        }
    }
}
